import React, {createContext} from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'
import {BrowserRouter, Route, Routes} from "react-router-dom";
import Posts from "./components/pages/Posts";
import PostBody from "./components/pages/PostBody";
import AddingArticle from "./components/pages/AddingArticle";
import Authrorize from "./components/pages/Authrorize";

const AppContext = createContext();

function App() {

    const [userData, setUserData] = useState({});

    return (
       <>
           <BrowserRouter>
               <Routes>
                   <Route path={"/"} element={<Posts />} />
                   <Route path={"/addingArticle"} element={<AddingArticle />} />
                   <Route path={"/post/:postId"} element={<PostBody />} />
                   <AppContext.Provider value={{ userData, setUserData }}>
                    <Route path={"/login"} element={<Authrorize />}/>
                   </AppContext.Provider>
               </Routes>
           </BrowserRouter>

       </>
    );
}

export default App;
